function ExpenseNewComponent(props) {
    const title = props.expenses.title;
    const amount = props.expenses.amount;
    const date = props.expenses.date;

    return(
        <div>
            <div>{title}</div>
            <div>{amount}</div>
            <div>{date}</div>
        </div>
    );
}

export default ExpenseNewComponent;
